sys_variable_value.value:
(function execute(inputs, outputs) {
	try {
		if (inputs.statusCode == "200") {
       		var responseBody = JSON.parse(inputs.responseBody);
			outputs = jsonFormatOutput(responseBody);
        }
		else
			outputs = errorHandler(inputs, outputs);
	} catch (e) {
		gs.error("Error: Encountered an error. Check log for more details.\nResponse Received: " + inputs.responseBody);
		outputs.status = "Error";
		outputs.errormessage = "Encountered an error. Check log for more details.";
	}

	function jsonFormatOutput(responseBody) {
		var allRecords = JSON.stringify(responseBody);
		outputs["status"] = "Success";
		outputs["output"] = allRecords;

		return outputs;
	}

	function errorHandler(inputs, outputs) {
		outputs.status = "Error";
		outputs.errormessage = (inputs.statusCode, inputs.responseBody.message);
		return outputs;
	}
})(inputs, outputs);

